    "title_main": "L\u00e1 b\u00e0i The Fool d\u1ef1 \u0111o\u00e1n nh\u1eefng s\u1ef1 th\u00e1ch th\u1ee9c xu\u1ea5t hi\u1ec7n ngay trong c\u01a1 h\u1ed9i m\u00e0 cu\u1ed9c s\u1ed1ng mang l\u1ea1i. L\u00e1 b\u00e0i n\u00e0y kh\u00f4ng kh\u1eb3ng \u0111\u1ecbnh c\u01a1 h\u1ed9i b\u1ea1n nh\u1eadn \u0111\u01b0\u1ee3c s\u1ebd d\u1eabn t\u1edbi s\u1ef1 th\u00e0nh c\u00f4ng hay th\u1ea5t b\u1ea1i, n\u00f3 ch\u1ec9 \u0111\u01a1n thu\u1ea7n l\u00e0 \u0111i\u1ec1m b\u00e1o t\u1ea1i th\u1eddi \u0111i\u1ec3m \u0111\u00f3 b\u1ea1n ph\u1ea3i c\u00f3 nh\u1eefng b\u01b0\u1edbc nh\u1ea3y trong cu\u1ed9c \u0111\u1eddi. The Fool \u0111\u01b0\u1ee3c \u0111\u00e1nh s\u1ed1 0, con s\u1ed1 bi\u1ec3u th\u1ecb m\u1ed9t s\u1ef1 m\u01a1 h\u1ed3 v\u00e0 kh\u00f3 x\u00e1c \u0111\u1ecbnh gi\u00e1 tr\u1ecb.", "title_secondary": "L\u00e1 b\u00e0i The Fool \u0111\u01b0\u1ee3c \u0111\u00e1nh s\u1ed1 0, con s\u1ed1 \u0111\u1ea1i di\u1ec7n cho s\u1ef1 v\u00f4 h\u1ea1n. S\u1ed1 0 c\u00f2n th\u1ec3 hi\u1ec7n s\u1ef1 ng\u00e2y th\u01a1 c\u1ee7a ng\u01b0\u1eddi r\u00fat ph\u1ea3i l\u00e1 b\u00e0i. L\u00e1 b\u00e0i xu\u00f4i \u00e1m ch\u1ec9 s\u1ef1 b\u1eaft \u0111\u1ea7u nh\u1eefng th\u00e1ch th\u1ee9c m\u1edbi, l\u00fac n\u00e0y b\u1ea1n s\u1ebd lu\u00f4n c\u0103ng tr\u00e0n n\u0103ng l\u01b0\u1ee3ng c\u00f9ng s\u1ef1 nhi\u1ec7t huy\u1ebft, khao kh\u00e1t t\u1ef1 do ph\u00e1 b\u1ecf m\u1ecdi r\u00e0ng bu\u1ed9c c\u1ee7a b\u1ea3n th\u00e2n t\u1eeb tr\u01b0\u1edbc \u0111\u1ebfn nay.\r\n\r\nNgo\u00e0i ra, s\u1ef1 s\u00e1ng t\u1ea1o ph\u00e1 b\u1ecf m\u1ecdi gi\u1edbi h\u1ea1n th\u00f4ng th\u01b0\u1eddng \u0111\u1ec3 \u0111\u1ea1t \u0111\u01b0\u1ee3c m\u1ee5c ti\u00eau l\u00e0 \u0111i\u1ec1u b\u1ea1n \u0111ang h\u01b0\u1edbng t\u1edbi. L\u00e1 b\u00e0i n\u00e0y \u0111\u1ea1i di\u1ec7n cho nh\u1eefng kh\u00f3 kh\u0103n trong th\u1eddi gian t\u1edbi, m\u1ed7i m\u1ed9t c\u01a1 h\u1ed9i h\u00e0ng ng\u00e0y \u0111\u1ec1u \u1ea9n ch\u1ee9a nh\u1eefng v\u1ea5n \u0111\u1ec1 m\u00e0 b\u1ea1n s\u1ebd ph\u1ea3i t\u1